// BAvatar custom styles

.b-avatar {
  display: inline-flex;
  align-items: center;
  justify-content: center;
  vertical-align: middle;
  font-weight: 400;
  line-height: 1;
  max-width: 100%;
  max-height: auto;
  text-align: center;
  text-transform: uppercase;
  white-space: nowrap;
  overflow: hidden;
  transition: color 0.15s ease-in-out, background-color 0.15s ease-in-out,
    box-shadow 0.15s ease-in-out;

  &:focus {
    outline: 0;
  }

  &a,
  &button,
  &.btn {
    padding: 0;
    border: 0;

    &:not(:disabled):not(.disabled) {
      cursor: if($enable-pointer-cursor-for-buttons, pointer, null);
    }
  }

  &.disabled,
  &:disabled,
  &[disabled] {
    opacity: $btn-disabled-opacity;
    pointer-events: none;
  }

  > span {
    border-radius: inherit;
  }

  .b-icon {
    width: 60%;
    height: auto;
    max-width: 100%;
    max-height: auto;
  }

  img {
    width: 90%;
    height: 90%;
    max-width: 100%;
    max-height: auto;
    border-radius: inherit;
  }
}

// BCalendar custom styles

.b-calendar {
  .b-calendar-inner {
    // Prevent calendar from going below this width
    min-width: 250px;
  }

  output.readonly {
    background-color: $input-disabled-bg;
    opacity: 1;
  }

  .form-control[role="application"] {
    // Easy rounded corners on contained elements,
    // specifically the footer of the calendar grid
    overflow: hidden;
  }

  .b-calendar-grid-body {
    .col[data-date] {
      // We hard code the sizes in `px` to fit
      // correctly on small mobile device screens
      .btn {
        width: 32px;
        height: 32px;
        font-size: 14px;
        line-height: 1;
        margin: 3px auto;
        padding: 9px 0;
      }
    }
  }

  // Style to get around Bootstrap v4.4 bug
  // with hand cursor on disabled buttons
  // As well, when a button is still focusable, but is
  // `aria-disabled` we want `pointer-events: none`
  .btn {
    &:disabled,
    &.disabled,
    &[aria-disabled="true"] {
      cursor: default;
      pointer-events: none;
    }
  }
}

.card-img-left {
  @include border-left-radius($card-inner-border-radius);
}

.card-img-right {
  @include border-right-radius($card-inner-border-radius);
}

$bv-dropdown-form-defined: false !default;

@if $bv-dropdown-form-defined == false {
