    }
  }
}

// BTime custom SCSS

.b-time {
  min-width: 150px;

  &[aria-disabled="true"] output,
  &[aria-readonly="true"] output,
  output.disabled {
    background-color: $input-disabled-bg;
    opacity: 1;
  }

  &[aria-disabled="true"] output {
    pointer-events: none;
